import React, { Component } from 'react';
import Navbar from './Navbar';
import './assets/css/listticket.css';

class TicketList extends Component {
    render() {
    return (
        <div>
        <div className="blog-card">
            <div className="meta">
              <div className="photo" style={{backgroundImage: "url(https://storage.googleapis.com/chydlx/codepen/blog-cards/image-1.jpg)"}}></div>
              <ul className="details">
                <li className="author"><a href="#">hello</a></li>
                <li className="date">{ this.props.waktu_asal } -> { this.props.waktu_tujuan }</li>
                <li className="tags">

                </li>
              </ul>
            </div>
            <div className="description">
              <h1>{ this.props.airline }</h1>
              <h2> { this.props.departureIataCode } -> { this.props.arrivalIataCode }</h2>
              {this.props.airline == 'Batik Air' && 
                    <p>Estimasi Harga: { this.props.estimasi_harga_batik }</p>
                }
                {this.props.airline == 'Citilink' && 
                    <p>Estimasi Harga: { this.props.estimasi_harga_citilink } </p> 
                }
                {this.props.airline == 'Garuda Indonesia' && 
                    <p>Estimasi Harga: { this.props.estimasi_harga_garuda } </p> 
                }
                {this.props.airline == 'Lion Air' && 
                    <p>Estimasi Harga: { this.props.estimasi_harga_lion } </p> 
                }
                {this.props.airline == 'Sriwijaya Air' && 
                    <p>Estimasi Harga: { this.props.estimasi_harga_sriwijaya } </p> 
                }
                {((this.props.airline != 'Sriwijaya Air') &&  (this.props.airline != 'Batik Air') && (this.props.airline != 'Citilink') && (this.props.airline != 'Garuda Indonesia') && (this.props.airline != 'Lion Air')) &&
                 <p>Estimasi Harga: { this.props.estimasi_harga_lain }</p> }
            </div>
            </div>            
        </div>
        );
    }
}

export default TicketList;
